      content: >-
        [head=2]Применение медицинских криокапсул на станции Renga[/head]


        Устройство: две медицинские криокапсулы, подключенные к замкнутому контуру с охладителем фильтром, подключенным в систему скрубберов; замкнутый контур получает воздушную смесь от насоса, питающегося от порта для канистр и опционально от системы вентиляции.


        [bold]Первичная настройка перед использованием[/bold]:

        1. Настроить охладитель на минимальную температуру.

        2. Подключить канистру воздуха гаечным ключом ИЛИ открыть ручной клапан для использования воздуха из системы вентиляции.

        3. Включить насос, не меняя его настройки (101,3 кПа).

        4. Включить газовый фильтр, не меняя его настройки.


        [bold]Способ применения[/bold]:

        1. Включить охладитель.

        2. Дождаться полного охлаждения поступившей воздушной смеси, используя для отслеживания температуры газоанализатор или интерфейс медицинской криокапсулы.

        3. Установить пациента в медицинскую криокапсулу.

        4. Дождаться его охлаждения.

        5. Установить мензурку с лекарством в медицинскую криокапсулу.

        6. Отслеживать состояние пациента до полного выздоровления, затем извлечь мензурку с лекарством.

        7. Установить мензурку с лекарством для стабилизации температуры тела (лепоразин) в медицинскую криокапсулу.

        8. Отслеживать температуру тела пациента до её нормализации, затем извлечь мензурку с лекарством.

        9. Извлечь пациента.

