    - type: Paper
      content: >-
        [head=2]Пангалактический глыздодёр[/head]


        [italic]Один из самых крепких алкогольных напитков во вселенной. Изобретён Зафодом Билброксом, а его действие похоже на то, что вам вышибают мозги кусочком лимона, в который завернут большой золотой кирпич.[/italic]


        [bold]Для приготовления понадобится[/bold]:

        [bullet] 20 ед. водки,

        [bullet] 20 ед. коньяка,

        [bullet] 20 ед. джина,

        [bullet] 20 ед. виски,

        [bullet] 20 ед. лаймового сока,

        [bullet] шейкер.


        [bold]Результат:[/bold] пять стаканов пангалактического глыздодёра.


        [bold]Способ приготовления[/bold]:

        1. К содержимому бутылки водки добавьте крепкий коньяк с одной из планет, смешав их в шейкере.

        2. Затем растворите в смеси кубики замороженного джина (предварительно хорошо охлаждённого, а то вкус улетучится).

        3. Вылейте в получившийся раствор выдержанный виски возрастом от 30 лет.

        4. Аккуратной струйкой добавьте лаймовый сок так, чтобы он растёкся по всему раствору равномерно, не перемешивая ложкой!

        5. Встряхните шейкер, перемешав все составляющие.

        6. Напиток готов! Подавайте в высоких стаканах для коктейлей с декоративными зонтиками.
